const App = () => {
    useEffect(() => {
        alanBtn({
            key: alanKey,
            onCommand: ({command,articles}) => {
                if(command === 'newHeadlines'){
                    console.log(articles);
                }
            }
        })
    }, [])

    
    return (
        <div>
            <h1>Sheekar Banerjee - AI News Application</h1>
        </div>
    )
}
export default App;
